import { actionsType } from '../actions'

const initialState = {
    astronomy: {},
    error: false,
}

const astronomy = (state = initialState, action) => {
    switch (action.type) {
        case actionsType.ERROR:
        return {
            ...state,
            error: true,
        }
        case actionsType.RECEIVE_DATA:
        return {
            ...state, 
            astronomy: action.astronomy,
            error: false,
        }            
        default:
        return state
    }
}

export { astronomy }
